function v2t(time){
	time=time-800;
	var hours = Math.floor(time / 60)+8;
	var minutes = time - ((hours-8) * 60);
	if(hours.toString().length == 1) hours = '0' + hours;
	if(minutes.toString().length == 1) minutes = '0' + minutes;
	return hours+':'+minutes;
}

function makeTimeLables(){
	var labels=[];
	var index=0;
	for(j=800;j<1670;j=j+5){
		labels[index]=v2t(j);
		index++;
	}
	return labels;
}

function updateDay(){
	updateTime();
	var test=0;
	var s=[];
	var a=[];
	var index=0;
	var max=0; 
	for(j=800;j<1670;j=j+5){
		var time=j -800;	
		var hours = Math.floor(time / 60)+8;
		var minutes = time - ((hours-8) * 60);
		if(hours.toString().length == 1) hours = '0' + hours;
		if(minutes.toString().length == 1) minutes = '0' + minutes;
		time = parseInt(hours.toString()+minutes.toString());
		
		var num=0;
		var classes=0;
		for(i=0;i<data.length;i++){
			
			
			if(isBetween(data[i],time)&& data[i].days.includes(days[document.getElementById("day-value").value])){
				num+=data[i].numStudents;
				classes++;				
				
			}
		}
		if(num>max) max=num;
		s[index]=num;
		a[index]=num/classes;
		index++;
	}
	console.log(max)
	var smean=0;
	for(i=0;i<index;i++){
		smean+=s[i]
	}
	smean=smean/i;
	var ssd=0;
	var asd=0;
	for(i=0;i<index;i++){
		ssd+=Math.pow(s[i]-smean,2);
	}
	ssd=ssd/i;
	ssd=Math.sqrt(ssd);
	
	var meanLine=[];
	var sdAbove=[];
	var sdBelow=[];
	for(i=0;i<index;i++){
		meanLine[i]=smean;
		sdAbove[i]=smean+ssd;
        sdBelow[i]=smean-ssd;
	}
	
	studentsInClassChart.data.datasets[0].data=s;
	studentsInClassChart.data.datasets[1].data=meanLine;
	studentsInClassChart.data.datasets[2].data=sdAbove;
	studentsInClassChart.data.datasets[3].data=sdBelow;
	
	document.getElementById('mean-num').innerHTML=smean.toFixed(2);
	document.getElementById('SD-num').innerHTML=ssd.toFixed(2);
	document.getElementById('max-num').innerHTML=max;
	
	studentsInClassChart.update();	
	avgSizeChart.data.datasets[0].data=a;
	avgSizeChart.update();
	
	
}

function updateTime(){
	var time=document.getElementById('time-slider').value -800;
	
	var hours = Math.floor(time / 60)+8;
	var minutes = time - ((hours-8) * 60);
	if(hours.toString().length == 1) hours = '0' + hours;
	if(minutes.toString().length == 1) minutes = '0' + minutes;
	
	document.getElementById('current-time').innerHTML=hours+':'+minutes;

	time = parseInt(hours.toString()+minutes.toString());
	
	var studentsInClass=0;
	var classCount=0;
	
	var chartBuildings = {
		AA:0,
		LH:0,
		FA:0,
		UU:0,
		LN:0,
		EB:0,
		S2:0,
	}
	
	mapData = {
	  max: 1000,
	  data: []
	};
	for(i=0;i<data.length;i++){
		if(isBetween(data[i],time)&& data[i].days.includes(days[document.getElementById("day-value").value])){
			//error checking
			if(buildings[data[i].location]==undefined){
				console.log(data[i]);
			}
			
			//mappings
			var lat=buildings[data[i].location].lat;
			var lng=buildings[data[i].location].lng;
			mapData.data.push({lat: lat, lng:lng, count: data[i].numStudents})
		
			//side floater data
			studentsInClass += data[i].numStudents;
			classCount++;
			
			//buildling breakdown chartBuildings
			switch (data[i].location) {
				case "AA":
					chartBuildings.AA+=data[i].numStudents;
					break;
				case "LH":
					chartBuildings.LH+=data[i].numStudents;
					break;
				case "FA":
					chartBuildings.FA+=data[i].numStudents;
					break;
				case "UU":
					chartBuildings.UU+=data[i].numStudents;
					break;
				case "LN":
					chartBuildings.LN+=data[i].numStudents;
					break;
				case "EB":
					chartBuildings.EB+=data[i].numStudents;
					break;
				case "S2":
					chartBuildings.S2+=data[i].numStudents;
					break;
			}
		}
	}
	
	prepareBuildingNumChart(chartBuildings);
	
	
	document.getElementById('students-in-class').innerHTML=studentsInClass;
	document.getElementById('class-count').innerHTML=classCount;
	heatmap.setData(mapData);
}

function prepareBuildingNumChart(b){
	var data=[];
	data[0]=b.AA;
	data[1]=b.LH;
	data[2]=b.FA;
	data[3]=b.UU;
	data[4]=b.LN;
	data[5]=b.EB;
	data[6]=b.S2;
	buildingNumChart.data.datasets[0].data=data;
	buildingNumChart.update();
}

